import React from 'react';

const UserDetails = ({ match }) => {
    if (!match) {
        return <div>Error: Match object is undefined</div>;
      }
  const otp = match.params.otp;

  // Fetch user details based on the otp parameter and display them
  // You can fetch the data using an API call or use the data you already have

  return (
    <div>

      <h2>User Details for OTP: {otp}</h2>

    </div>
  );
};

export default UserDetails;
